import Basic from "../src/Images/img1.jpg";
import Standard from "../src/Images/img2.jpg";
import software from "../src/Images/img3.jpg";
import digital from "../src/Images/img4.jpg";
import andriod from "../src/Images/img5.jpg";
import marketing from "../src/Images/img6.jpg";

const CardData = [
    {
        imgsrc: Basic,
        title: "Basic Package",
        text: "Hello"
    },
    {
        imgsrc: Standard,
        title: "Standard Package",
        text: "Hello"
    },
    {
        imgsrc: software,
        title: "Software Development",
        text: "Hello"
    },
    {
        imgsrc: digital,
        title: "Digital Marketing",
        text: "Hello"
    },
    {
        imgsrc: andriod,
        title: "Andriod Development",
        text: "Hello"
    },
    {
        imgsrc: marketing,
        title: "Marketing",
        text: "Hello"
    },
]

export default CardData;
